import react from 'react';
import './App.css';
import { connect } from 'react-redux';
import {
  increaseCounter,
  decreaseCounter
} from "./redux/Counter/counter.actions";

function App() {
  return (
    <div className="App">
      <div>Count: </div>
      <button>Increase Count</button>
      <button>Decrease Count</button>
    </div>
  );
}

export default App;
